import React, { Component } from "react";
import { Redirect } from "react-router-dom";
import AuthService from "../services/auth.service";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../style/StyleProduced.css'

export default class produced extends Component {
  constructor(props) {
    super(props);

    this.state = {
      namefood : '',
      price : '',
      detail : '',
      idCategory:''
    };
  }

  componentDidMount() {
    const currentUser = AuthService.getCurrentUser();

    if (!currentUser) this.setState({ redirect: "/produced" });
    this.setState({ currentUser: currentUser, userReady: true })
  }

  render() {
    if (this.state.redirect) {
      return <Redirect to={this.state.redirect} />
    }

    // const { currentUser } = this.state;

    return (
        <div className="list-item">
          <div className="item">
            <div>
              <img src="../chup-san-pham.jpg"/>
              <h5 className="list-Title-food">Cơm chiên</h5>
              <div className="list-detail">Nguyễn Bình</div>
              <button className = "list-btn">Đặt món</button>
            </div>
          </div>
        </div>
    );
  }
}
